import Slider from "react-slick";
import HeadLine from "../../../component/Headline/Headline";

const MilkTea = () => {
    var settings = {
        infinite: false,
        speed: 500,
        slidesToScroll: 2,
        slidesToShow: 6,
    };
    return (
        <div className="milkTea">
            <HeadLine headline={"Milk Tea"}></HeadLine>
            <div className="slider-container">
                <Slider {...settings}>
                    <div className="milktea-box">
                        <div>
                            <img src="" alt="" />
                        </div>
                        <div>
                            <h3>name</h3>
                        </div>
                    </div>
                </Slider>
            </div>
        </div>
    );
};

export default MilkTea;
